import React, { Component } from 'react';
import { Map, TileLayer, GeoJSON, Marker, Popup} from 'react-leaflet';
import data2 from 'geojson-world-map';
import data1 from './sample.json';
import data3 from './us-states.json';
import data4 from './esa09.json';
import data from './file_copy.json';

const center = [-23.116667, 132.133333]
const rectangle = [
  [51.49, -0.08],
  [51.5, -0.06],
]
function getColor(d1) {
    var d = Math.floor(Math.random() * Math.floor(1001));
    return d > 1000 ? '#800026' :
           d > 500  ? '#BD0026' :
           d > 200  ? '#E31A1C' :
           d > 100  ? '#FC4E2A' :
           d > 50   ? '#FD8D3C' :
           d > 20   ? '#FEB24C' :
           d > 10   ? '#FED976' :
                      '#FFEDA0';
}

class App extends Component {

  render() {
    return (
      <div>
        <h3 style={{ textAlign: "center" }}>Most Populous Cities inÂ Asia</h3>
        <Map center={center} zoom={5} style={{ height: "900px" }}>
  <TileLayer
    attribution="&amp;copy <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors"
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
  />
          <GeoJSON
          data={data}
          style={(feature) => ({
            color: '#4a83ec',
            weight: 0.5,
            fillColor: getColor(feature.properties.density),
            fillOpacity: 0.7,
          })}
        />
         <Marker position={[50, 10]}>
          <Popup>
            Popup for any custom information.
          </Popup>
        </Marker>
</Map>

      </div>
    );
  }
}

export default App;
